import React from "react";

const Cart = ({ buttonSliderContent }) => {
  return (
    <div>
      {buttonSliderContent.map((item, index) => (
        <div key={index}>
          <img src={item.img} alt="Slide" />
          <p>{item.text}</p>
        </div>
      ))}
    </div>
  );
};

export default Cart;
